class TodoAddForm extends Component {
    render() {

        const onSubmit = (e) =>{
            e.preventDefault();
            console.log("add");
        }

        return (
            <form onSubmit={onSubmit}>
                <input
                type="text"
                placeholder="할일을 적어주세요"
                value={e.target.value}
                />
                <button>추가</button>
            </form>
        );
    }
}

export default TodoAddForm;
